import React from "react";
import { SubMenuListItem } from "./SubMenuListItem";


export function SubMenuList({subMenu}){
    return (
        <ul className="full-width menu-principal sub-menu-options sub-menu-options-show">
            {subMenu.map((subMenuItem,index) =>(<MenuListSubItem key={index} menuSubItem={subMenuItem}/>))}
        </ul>
    )
}
